import React,{Component} from 'react';
import './contact.css';
import 'tachyons';

class Contact extends Component {
  constructor() {
    super();
  }
  render(){

    return (
      <div id="outer">
      <div id="inner" >
      <div className="form">
      <h1>Contact Us</h1>
      </div>
      </div>
    </div>
    );
  }
}

export default Contact;
